import React from "react";
import ReactDOM from "react-dom";
import QRCode from "react-qr-code";

const QRSection = () => {
  return (
    <div className="qrcode-section m-8  h-full bg-white rounded">
      <QRCode className="h-16 object-contain" value="Hi Ameg" />
    </div>
  );
};
export default QRSection;
